(1, '1', 'This is a card that has been redeemed. I have uploaded the screenshots. And If you think that your card was used by this site , please provide us with evidence of ownership. Please write your Username, today\'s date, time & \"Niratrade .com\" on the receipt and upload it here. Then contact iTunes Support and ask about the exact time and date the card was redeemed and if possible ask by which Apple ID. Make a voice recording of your conversation and upload the recording to a file sharing service (google drive, dropbox etc) and share a link here within 24h.', 'read', '2018-05-23 22:31:42'),
